import React from "react";
import styled from "styled-components";

const HeaderContainer = styled.div`
    width: 100%;
    background-color: white;
    height: 150px;
`

const Header = () => {
    return (
        <>
        <HeaderContainer />
        </>
    )
}

export default Header;
